# https://leetcode.com/problems/surrounded-regions/description/
class Solution(object):
    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        if len(board) == 0: return

        row_len = len(board)
        col_len = len(board[0])
        for j in range(col_len):
            # Mark leaked 'O' as '#'
            if board[0][j] == 'O':
                self.mark_leak_DFS(board, 0, j)
            if board[row_len - 1][j] == 'O':
                self.mark_leak_DFS(board, row_len - 1, j)
        for i in range(1, row_len - 1):
            if board[i][0] == 'O':
                self.mark_leak_DFS(board, i, 0)
            if board[i][col_len - 1] == 'O':
                self.mark_leak_DFS(board, i, col_len - 1)

        # Now flip all remaining 'O' to 'X' and rollback '#' to 'O'
        for i in range(row_len):
            for j in range(col_len):
                if board[i][j] == 'O':
                    board[i][j] = 'X'
                elif board[i][j] == '#':
                    board[i][j] = 'O'

    def mark_leak_DFS(self, board, i, j):
        # Recursion is too deep, we use stack iteration
        stack = [(i, j)]
        while len(stack) > 0:
            i, j = stack.pop()
            if i < 0 or i >= len(board) or j < 0 or j >= len(board[0]) or board[i][j] == '#' or board[i][j] == 'X':
                continue
            board[i][j] = '#'
            stack.append((i - 1, j))
            stack.append((i + 1, j))
            stack.append((i, j - 1))
            stack.append((i, j + 1))


